export const sceneDeviceLook = (id, times, isPlane, td=() => {}) => {
    allDeviceFocus.forEach((item) => {
        if (item.userData.id == id) {
            tweenMoveView(
                item.userData.focusControls,
                item.userData.focusCamera,
                // [
                //     item.userData.focusControls[0],
                //     item.userData.focusControls[1] + 200,
                //     item.userData.focusControls[2] + 10,
                // ],
                times,
                () => {
                    if (isPlane) {
                        cameraModelPlane.position.set(
                            ...item.userData.focusControls
                        );
                        cameraModelPlane.visible = true;
                    }
                    let outArr = [];
                    item.traverse((s) => {
                        if (s.isMesh) {
                            outArr.push(s);
                        }
                    });
                    container.outlineObjects = outArr;
                    td && td();
                }
            );
        }
    });
};

// 收尘动画展示隐藏  type = 1(破碎间)  2(筛分间)  3(碎石配料间)  speed = 速度   bool = true(显示)  false(隐藏)
export const shoucengAnimations = (type, speed = 0.01, bool) => {
// window.shoucengAnimations = (type, speed = 0.01, bool) => {
    if(type == 1) {
        shouchengPSw.forEach(item => {
            if(bool) {
                item.material.transparent = true;
                item.material.opacity = 0.3;
                item.renderOrder = 2000;
            }else  {
                item.material.transparent = false;
                item.material.opacity = 1;
                item.renderOrder = 2;
            }
        })
        shouchengPSspeed = speed;
        shouchengPSType = bool;
    }else if (type == 2) {
        shouchengSFw.forEach(item => {
            if(bool) {
                item.material.transparent = true;
                item.material.opacity = 0.3;
                item.renderOrder = 2000;
            }else  {
                item.material.transparent = false;
                item.material.opacity = 1;
                item.renderOrder = 2;
            }
        })
        shouchengSFspeed = speed;
        shouchengSFType = bool;
    }else if (type == 3) {
        shouchengSSw.forEach(item => {
            if(bool) {
                item.material.transparent = true;
                item.material.opacity = 0.3;
                item.renderOrder = 2000;
            }else  {
                item.material.transparent = false;
                item.material.opacity = 1;
                item.renderOrder = 2;
            }
        })
        shouchengSSspeed = speed;
        shouchengSSType = bool;
    }
}